// frontend/src/App.js - Updated with HR Job Management Routes
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { AuthProvider } from './contexts/AuthContext';
import Navbar from './components/Navbar/Navbar';
import Homepage from './components/Homepage/Homepage';
import Login from './components/Login/Login';
import Register from './components/Register/Register';
import Companies from './components/Companies/Companies';
import AdminDashboard from './components/Admin/AdminDashboard';
import CompanyManagement from './components/Admin/CompanyManagement';
import HRDashboard from './components/HR/HRDashboard';
import JobCreation from './components/HR/JobCreation';
import JobManagement from './components/HR/JobManagement';
import Profile from './components/Profile/Profile';
import './styles/global.css';

function App() {
  return (
    <div className="App">
      <AuthProvider>
        <Router>
          <Navbar />
          <Routes>
            {/* Public Routes */}
            <Route path="/" element={<Homepage />} />
            <Route path="/login" element={<Login />} />
            <Route path="/register" element={<Register />} />
            <Route path="/companies" element={<Companies />} />

            {/* Profile Routes */}
            <Route path="/profile" element={<Profile />} />

            {/* Admin Routes */}
            <Route path="/admin/dashboard" element={<AdminDashboard />} />
            <Route path="/admin/companies" element={<CompanyManagement />} />

            {/* HR Routes */}
            <Route path="/hr/dashboard" element={<HRDashboard />} />
            <Route path="/hr/jobs" element={<JobManagement />} />
            <Route path="/hr/jobs/create" element={<JobCreation />} />

            {/* Future Routes - เตรียมไว้สำหรับการพัฒนาต่อ */}
            {/* <Route path="/hr/jobs/:id" element={<JobDetail />} /> */}
            {/* <Route path="/hr/jobs/:id/edit" element={<JobEdit />} /> */}
            {/* <Route path="/hr/applications" element={<ApplicationManagement />} /> */}
            {/* <Route path="/hr/analytics" element={<HRAnalytics />} /> */}
            {/* <Route path="/student/dashboard" element={<StudentDashboard />} /> */}
            {/* <Route path="/student/jobs" element={<JobBoard />} /> */}
            {/* <Route path="/student/applications" element={<MyApplications />} /> */}
          </Routes>
        </Router>
      </AuthProvider>
    </div>
  );
}

export default App;
